import { Component } from '@angular/core';

interface Option {
  label: string;
  value: boolean;
}

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  options: Option[] = [
    { label: 'Yes', value: true },
    { label: 'No', value: false }
  ];

  agreeCount = 0;
  disagreeCount = 0;

  onVote(value: boolean) {
    if (value === true) {
      this.agreeCount++;
    } else if (value === false) {
      this.disagreeCount++;
    }
  }
}

<h1>Should mankind colonize the Universe?</h1>
<app-vote [options]="options" (vote)="onVote($event)"></app-vote>

<div>
  <p>Agree: {{ agreeCount }}</p>
  <p>Disagree: {{ disagreeCount }}</p>
</div>
